armoede.kaart = armoede.kaart.extendsFrom(Function.extensions);

armoede.kaart.prototype.create=function(parent, cat) {
	var self = this;
	this.parent = parent;

	var h = d3.select(this.parent).style('height').replace('px',''),
		w = d3.select(this.parent).style('width').replace('px','');

	this.width = w;
	this.height = h;

	var container = d3.select(this.parent).select('svg');
	if(container.empty() == true) {
		this.svg = d3.select(this.parent).append("svg")
			.append("g")
				.attr("class", this.id)
	} else {
		this.svg = container.select('#'+this.id);
	}

	tmp = d3.select(this.parent).select('svg')
	tmp
		.attr("width", this.width+'px')
		.attr("height", this.height+'px');
	
	this._calc();

	var obj = this.svg.append("g")
		.attr("id", "states")
			.selectAll("path")
				.data(this.geo.features)
					.enter()
						.append("path")
							.attr("class", function(d, i) {
								if('properties' in d) {
									if('klasse' in d['properties']) {
										if(d['properties']['klasse'] == 'stadsdeel') {
											return "stadsdeel";
										}
										if(d['properties']['klasse'] == 'bebouwing_referentie') {
											return 'referentie bebouwing';
										}
										if(d['properties']['klasse'] == 'water_grof') {
											return 'water';
										}
										if(d['properties']['klasse'] == 'ringweg') {
											return 'ringweg';
										}
										if(d['properties']['klasse'] == 'wijk_water') {
											if('code' in d['properties'] && [98,73,80].indexOf(parseInt(d['properties']['code'])) == -1) {
												return 'wijk _'+parseInt(d['properties']['code']);
											}
											return 'wijk';
										}
										if(d['properties']['klasse'] == 'wijk_agglomeratie') {
											if('code' in d['properties']) {
												return 'wijk _'+parseInt(d['properties']['code']);
											}
											return 'wijk';
										}
									}
								}
							})
							.attr("d", this.path);


	this.parseLegend(0);
	this.setCat(cat);
}


armoede.kaart.prototype.parseLegend=function(x) {
	var self = this;

	var obj = null;
	var tmp = null;
	if(x == 0) {
		obj = this.svg.selectAll('.legend')
			.data([0, 1, 2, 3, 4, 5])
				.enter()
	} else {
		tmp = this.svg.selectAll(this.parent+' rect.legend')
	}

	if(x == 0) {
		tmp = obj.append('rect')
	} else {
		if(this.transitionSpeed > 0 && this.transition == true) {
			tmp = tmp.transition().duration(this.transitionSpeed)
		}
	}
	tmp
		.attr("class", "legend")
		.attr("x", this.width/50)
		.attr("y", function(d, i) {
			return (self.height-12)-((5-i)*8)-(7*(5-i));
		})
		.attr("width", 8)
		.attr("height", 8)
		.style('stroke', 'black')
		.style('stroke-width', '0.5');

		if(x < 2) {
			tmp.style('fill', '#FFF');
		}

	var tmp = null;
	if(x == 0) {
		tmp = obj.append('text')
	} else {
		tmp = this.svg.selectAll(this.parent+' text.legend')
		if(this.transitionSpeed > 0 && this.transition == true) {
			tmp = tmp.transition().duration(this.transitionSpeed)
		}
	}
	tmp
		.attr("class", "legend")
		.attr("font-size", function(d, i) {
			if(self.height < 400) {
				return 12;
			} else {
				return 12;
			}
		})
		.style("fill", "black")
		.attr("x", function(d, i) {
			return (self.width/50+10+5);
		})
		.text(function(d, i) {
			return self.legend[i];
		})
		.attr("y", function(d, i) {
			return (self.height-12)-((5-i)*9)-(6*(5-i))+7;
		})	
}

armoede.kaart.prototype.setCat=function(cat) {
	var self = this;
	if(cat > 0) {
		var wijken = [];
		for(i in this.data) {
			n = this.data[i][0].toString();
			if(typeof(n) == 'string') {
				n = n.toLowerCase();
			}

			if(cat in this.data[i] && this.data[i][cat] != 9) {
				val = this.data[i][cat];
				d3.selectAll(this.parent+" ._"+parseInt(n))
					.transition().duration(500).delay(250).ease("linear")
						.style("fill", function() {
							if([4, 5, 6, 7].indexOf(cat) > -1) {
								return self.blue[val]
							} else {
								return self.red[val];
							}
						});
			} else {
				d3.selectAll(this.parent+"  ._"+parseInt(n))
					.transition().duration(500).delay(250).ease("linear")
						.style("fill", '#e8e8e8')
			}
		}

		this.parseLegend(1);

		tmp = this.svg.selectAll(this.parent+' rect.legend')
		if(this.transitionSpeed > 0 && this.transition == true) {
			tmp = tmp.transition().duration(this.transitionSpeed)
		}
		tmp
			.style("fill", function(d, i) {
				if([4, 5, 6, 7].indexOf(cat) > -1) {
					return self.blue[i]
				} else {
					return self.red[i];
				}
		});
	}

}

armoede.kaart.prototype._calc=function() {
	var self = this;

	this.center = d3.geo.centroid(this.geo);
	this.projection = d3.geo.mercator().scale(1).center(this.center).translate([0,0]);
	this.path = d3.geo.path().projection(this.projection);

	var bounds  = this.path.bounds(this.geo);
	bounds.dx = Math.abs(bounds[1][0] - bounds[0][0]);	// distance x = E-W
	bounds.dy = Math.abs(bounds[1][1] - bounds[0][1]);	// distance y = N-S
	bounds.cx = (bounds[1][0] + bounds[0][0]) / 2; 	// center x
	bounds.cy = (bounds[1][1] + bounds[0][1]) / 2; 	// center y

	var ratio = (bounds.dy / bounds.dx );
	this.scale = 1 * Math.min(this.width/bounds.dx, this.height/bounds.dy); // = .9 * ( width / b.dx)
	this.translate = [(this.width/2 - this.scale * bounds.cx), (this.height/2 - this.scale * bounds.cy)];

	this.projection.scale(this.scale).translate(this.translate);
	this.path.projection(this.projection);

	this.parseLegend(2);
}

armoede.kaart.prototype.redraw=function() {
	var h = d3.select(this.parent).style('height').replace('px',''),
		w = d3.select(this.parent).style('width').replace('px','');

	this.width = w;
	this.height = h;

	tmp = d3.select(this.parent).select('svg')
	if(this.transitionSpeed > 0 && this.transition == true) {
		tmp = tmp.transition().duration(this.transitionSpeed)
	}	

	tmp
		.attr("width", this.width+'px')
		.attr("height", this.height+'px')

	this._calc();

	var obj = this.svg.select('#states').selectAll('path')
		.transition().duration(this.transitionSpeed)
			.attr("d", this.path);
}